一定数の担当者(ユーザまたはグループ)がタスク実行済みの場合に、タスク完了と判断する終了条件クラス。
<p/> 一定数の指定は、本クラスのインスタンス生成時に指定する。 一定数に満たない場合でも、全てのユーザ(グループ)が処理済みとなった場合には、 これ以上処理するユーザ(グループ)がいないため、タスク完了と判断する。 
@since 1.4.2

