<p/> 
@since 1.4.2

指定のパラメータ値が、期待する値を一致しないことのチェックを行うフロー進行条件クラス。
<p/> 
@since 1.4.2

指定のパラメータ値が、期待する値を一致するかチェックを行うフロー進行条件クラス。
<p/> 
@since 1.4.2

